// src/App.js
import React from "react";
import SystemConfig from "./components/SystemConfig";
import VisualRepresentation from "./components/VisualRepresentation";

import "./App.css";

const App = () => {
	return (
		<div className="App">
			<SystemConfig />
			<VisualRepresentation />
		</div>
	);
};

export default App;
